import React, { useState, useEffect } from "react";

const Jackets = () => {
  const [jackets, setJackets] = useState([]);

  useEffect(() => {
    fetch("/api/jackets")
      .then((response) => response.json())
      .then((data) => setJackets(data))
      .catch((error) => console.error("Error fetching jackets:", error));
  }, []);

  return (
    <div>
      <h1>Jackets</h1>
      {jackets.length === 0 ? (
        <p>No products available.</p>
      ) : (
        <ul>
          {jackets.map((jacket) => (
            <li key={jacket.id}>{jacket.name}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Jackets;
